# fopen 

- Eğer açma işlemi başarılıysa fopen fonksiyonu dosya işaretçisi döndürür. Başarısızsa null döndürür.
- Dosya işaretçisi tanımlamak ve yeni dosya oluşturmak için;

FILE *dosya_gostergesi;
dosya_gostergesi=fopen("Yeni Metin Belgesi.txt", "w");

- FILE tipi ve fopen gibi fonksiyonlar stdio.h kütüphanesinde tanımlıdırlar.
- fopen fonksiyonu işletim sistemine dosyanın kullanıldığını bildirir ve işletim sistemi o dosyanın başka programlar tarafından işlenmesine, silinmesine izin vermez

# Metin Dosyası İşlemleri

- Okuma ve yazma işlemlerini yapan fonksiyonlar 3 çeşittir:
  - karakter bazında işlem yapanlar: fputc, fgetc
  - biçimlendirilmiş metin bazında: fprintf, fscanf
  - satır bazında: fputs, fgets
  - dosya_gostergesi ile işaret edilen bir dosyaya karakter yazdırma işlemi yapmak için;

fputc(‘z’, dosya_gostergesi)

- Örnek-2:

```c
#include<stdio.h>
main() {
    FILE *dosya_gostergesi;
    dosya_gostergesi=fopen("Deneme3 Metin Belgesi.txt", "w");
    fputc('A',dosya_gostergesi);
    return 0;
}

# fgete, gete 

- Her iki fonksiyon da kendisine parametre olarak gelen dosyadan tek bir karakter okumaya yarar.
- Dosya yolu yazılmazsa programın bulunduğu klasör kastedilmiş olur.
- dosya=fopen("D:\\Deneme\\Deneme4 Metin Belgesi.txt", "r");
- Örnek-4a: EOF
while içinde okunan s değeri, EOF değilse döngü çalışmaya devam eder

```
#include<stdio.h>
main() {
    FILE *dosya;
    dosya=fopen("Deneme4 Metin Belgesi.txt", "r");
    char s;
    while((s=fgetc(dosya))!=EOF)
    {
    printf("%c",s);
    }
    fclose(dosya);
    return 0; }
```

# fgete, gete 

- Örnek-4b:
feof fonksiyonu sıfır dışında bir değer döndürdüğünde dosya sonuna gelinmiştir.

```
#include<stdio.h>
main() {
    FILE *dosya;
    dosya=fopen("Deneme4 Metin Belgesi.txt", "r");
    if (dosya == NULL) //Dosya açılamazsa çıkış yapılacak
        return 0;
    do
        { char c = fgetc(dosya); // Her seferinde tek karakter alacak
        if (feof(dosya)) //Okunacak değer varsa sıfır değeri döndürülür
            break ;
        printf("%c", c);
    } while(1);
    fclose(dosya);
    return 0; }
```

# fprintf ve fscanf 

- Biçimlendirilmiş metin bazında işlem yapan bu iki fonksiyon aslında printf ve scanf gibi çalışır.
- fscanf"in farkı klavyeden okumak yerine dosyadan okumaktır.
- fprintf"in farkı ekrana yazmak yerine dosyaya yazmaktır.
- Belirtilen dosya akışı üzerinden çalışmaktadır.
- Örnek-5:

```
#include<stdio.h>
main() {
    FILE *dosya1, *dosya2;
    char ch;
    dosya1=fopen("Deneme3 Metin Belgesi.txt", "r");
    dosya2=fopen("Deneme4 Metin Belgesi.txt", "r+");
    if (dosya1 == NULL) //Dosya açlamazsa çıkış yapılacak
    {printf("dosya1 bulunamadi\n");
    return 0;
    }
    fscanf(dosya1,"%c",8ch); // 1.dosyadaki A karakteri okunuyor
    if (dosya2 == NULL) //Dosya açlamazsa çıkış yapılacak
    {printf("dosya2 bulunamadi\n");
    return 0;
    }
    fprintf(dosya2,"%c",ch); // 2.dosyanın başına A karakteri yazılıyor
    fclose(dosya1);
    fclose(dosya2);
    return 0; }
```
